import styled from 'styled-components';
import { BrowserRouter as Router, R } from 'react-router-dom';

import { productContextProvider } from './context/Products';
function App() {


  return (

    <productContextProvider>
      <Router>
        <Route path="/" />
      </Router>
    </productContextProvider>

  );
}

const Heading = styled.h1`
  color: green;
  background: red;
  font-size: 40px;
  `

export default App;
